import Header from './components/Header/Header';
import React from 'react';
import Home from './pages/Home';
import './scss/app.scss';

function App() {

	return (
		<div className="wrapper">
			<Header />
			<div className="content">
				<div className="container">
					<Home />
				</div>
			</div>
		</div>
	);
}

export default App;
